import { Icon } from '@iconify/react';
import React, { useState } from 'react';
import SectionHeading from './SectionHeading';
import Slider from 'react-slick';
import Modal from './Modal';
import './Projects.css'; // Your CSS file for styling

const sampleData = {
  sectionHeading: {
    miniTitle: 'Our Work',
    title: 'Recent Projects',
  },
  allProjects: [
    {
      thumbUrl: '/images/popup-project-1.jpg',
      title: 'Website Design',
      subTitle: 'Web Design, App Design',
      details: {
        title: 'Website Design for Marketing Agency Startup',
        description:
          'Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. <br><br>xcepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.',
        type: 'Website',
        langages: 'PHP, HTML, CSS, JS',
        platform: 'WordPress',
        country: 'USA',
        url: 'www.example.com',
      },
    },
    // Add more project objects here...
  ],
};

export default function Projects({ data = sampleData }) {
  const [modal, setModal] = useState(false);
  const [modalType, setModalType] = useState('image');
  const [modalData, setModalData] = useState({});
  const { sectionHeading, allProjects } = data;

  const handelProjectDetails = (item, itemType) => {
    setModalData(item);
    setModalType(itemType);
    setModal(!modal);
  };

  const settings = {
    dots: true,
    arrows: false,
    infinite: true,
    autoplay: false,
    autoplaySpeed: 4000,
    speed: 1000,
    slidesToShow: 1,
    slidesToScroll: 1,
    initialSlide: 0,
    variableWidth: true,
  };

  return (
    <>
      <section className="project-section section gray-bg" id="project">
        <div className="container">
          <SectionHeading
            miniTitle={sectionHeading.miniTitle}
            title={sectionHeading.title}
          />
          <div
            className="full-width"
            data-aos="fade"
            data-aos-duration="1200"
            data-aos-delay="400"
          >
            <Slider {...settings} className="slider-gap-24">
              {allProjects?.map((item, index) => (
                <div
                  key={index}
                  className="slider-item-wrapper"
                  style={{ width: '416px' }}
                >
                  <div className="project-container">
                    <div className="project-box">
                      {/* Media container */}
                      <div className="project-media-container">
                        <img
                          src={item.thumbUrl}
                          alt={`Thumbnail for ${item.title}`}
                          className="project-media-image"
                        />
                        <span
                          className="gallery-link"
                          onClick={() => handelProjectDetails(item, 'image')}
                        >
                          <i>
                            <Icon icon="bi:plus" />
                          </i>
                        </span>
                      </div>

                      {/* Body container */}
                      <div className="project-body-container">
                        <div className="project-text-content">
                          <h5>{item.title}</h5>
                          <span>{item.subTitle}</span>
                        </div>
                        <div className="project-link-container">
                          <span
                            className="p-link"
                            onClick={() => handelProjectDetails(item, 'details')}
                          >
                            <Icon icon="bi:arrow-right" />
                          </span>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </Slider>
          </div>
        </div>
      </section>

      {/* Modal */}
      {modal && (
        <div className="mfp-wrap">
          <div className="mfp-container">
            <div className="mfp-bg" onClick={() => setModal(!modal)}></div>
            <div className="mfp-content">
              <button
                type="button"
                className="mfp-close"
                onClick={() => setModal(!modal)}
              >
                Ã—
              </button>
              {modalType === 'image' ? (
                <img src={modalData.thumbUrl} alt="Thumbnail" />
              ) : (
                <Modal modalData={modalData} />
              )}
            </div>
          </div>
        </div>
      )}
    </>
  );
}
